"""
Given an integer array nums, handle multiple queries of the following type:
- Calculate the sum of the elements of nums between indices left and right inclusive where left <= right.

Implement the NumArray class:
- NumArray(int[] nums) Initializes the object with the integer array nums.
- int sumRange(int left, int right) Returns the sum of the elements of nums between indices left and right inclusive
    (i.e. nums[left] + nums[left + 1] + ... + nums[right]).
"""
from itertools import accumulate
from typing import List


class NumArray:
    def __init__(self, nums: List[int]):
        """
        :param nums: 1 <= len(nums) <= 10000, -1e5 <= nums[i] <= 1e5
        """
        self.acc_num = list(accumulate(nums))

    def sum_range(self, left: int, right: int):
        """
        :param left: 0 <= left <= right < len(nums)
        :param right: 0 <= left <= right < len(nums)
        :return: sum(nums[left: right + 1])
        """
        return self.acc_num[right] - self.acc_num[left - 1] if left else self.acc_num[right]


